import React from "react";
import Header from "../components/Header";
import Main from "../components/Main";
import Footer from "../components/Footer";
import Container from "react-bootstrap/Container";
import Hero from "../components/Hero";
import ItemListContainer from "../components/ItemListContainer";
import ItemDetailcontainer from "../components/ItemDetailContainer";

const Layout = () => {
  const personas = [
    { id: "1", name: "name1", Lastname: "lastname1" },
    { id: "2", name: "name2", Lastname: "lastname2" },
    { id: "3", name: "name3", Lastname: "lastname3" },
  ];
  const funcionSimple = (texto) => {
    console.log(texto);
  };
  return (
    <>
      <Container fluid className="d-flex flex-column min-vh-100 px-0">
        <Header />
        <Hero titulo="Estos viene por props" />
        <ItemListContainer />
        <ItemDetailcontainer />
        <Main
          personas={persona}
          Letra="estas son letras"
          callback={funcionSimple}
        />
        <Footer />
      </Container>
    </>
  );
};

export default Layout;
